  true,\n\t\"url\": null,\n\t\"notes\": \"This data from the National Weather Service
  provides Geographic Information System (GIS) graphical representations of tornados,
  large hail events, and damaging wind reports in the Continental United States for
  the period 1950 through 2006.  The data provided are in .zip files that are generally
  around 50 MB.  Although available to all, the data provided may be of particular
  value to weather professionals and students of meteorological sciences.  An instructional
  manual is provided on how to build and develop a basic severe weather report GIS
  database in ArcGis and is located at the technical documentation site contained
  in this metadata catalog.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
